import React from "react";
import "./styles/EmployeeTable.css";

class EmployeeTable extends React.Component {
  render() {
    return (
      <div className="container__table">
        <table>
          <tr>
            <th>Name</th>
            <th>E-mail</th>
            <th>Role</th>
            <th>DOB</th>
            <th>Gender</th>
          </tr>
          <tr>
            <td>Raynulfo Mata</td>
            <td>rjmata95@gmail.com</td>
            <td>Raynulfo</td>
            <td>09/09/2003</td>
            <td>Female</td>
          </tr>
        </table>
      </div>
    );
  }
}

export default EmployeeTable;
